import React from 'react';

import './App.css';

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://www.freepnglogos.com/uploads/eagles-png-logo/eagle-sports-png-logos--0.png" />
      </header>
      <nav className="nav">
        <div>
          <a>Profile</a></div>
      </nav>
      <div className="content">Main content</div>
    </div>
  );
}

export default App;
